import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class Header extends React.Component
{
  constructor(props)
  {
    super(props);
  }
  render()
  {return (
      <span class="align-top"><div class="container-fluid" id="tbox">
        <p id="title">{this.props.title}</p>

      </div></span>
    );
  }
}

class Footer extends React.Component
{
  constructor(props)
  {
    super(props);
  }
  render()
  {
    return (
      <div class="container-fluid" id="fbox">
        <div class="row">
          <div class="col-sm text"><a href="aboutme.html">About Me</a></div>
          <div class="col-sm text">GAN Project</div>
          <div class="col-sm text">Garage</div>
        </div>
      </div>
    );
  }
}

ReactDOM.render(<Header title="Michaela"/>, document.getElementById('root'));
